import { createTheme } from '@mui/material/styles';

const darkTheme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#ffe57f',
    },
    secondary: {
      main: '#112b6c',
    },
    background: {
      default: '#00031e',
      paper: '#191d3d',
    },
    success: {
      main: '#43a648',
    },
  },
  typography: {
    fontFamily: 'Exo 2, Open Sans, sans-serif',
  },
  props: {
    MuiAppBar: {
      color: 'transparent',
    },
  },
  shape: {
    borderRadius: 6,
  },
  breakpoints: {
    values: {
      xxs: 768,
      xs: 1024,
      sm: 1280,
      md: 1440,
      lg: 1600,
      xl: 1920,
      xxl: 2560,
    },
  },
  components: {
    MuiButton: {
      defaultProps: {
        size: 'large',
      },
    },
    MuiListItemText: {
      styleOverrides: {
        primary: {
          fontSize: '18px',
        },
      },
    },
    MuiTypography: {
      styleOverrides: {
        // Name of the slot
        body1: {
          // Some CSS
          fontSize: '18px',
        },
      },
    },
  },
});

export default darkTheme;
